import logo from './logo.svg';
import 'fontsource-roboto';
import { Typography } from '@material-ui/core';
import './App.css';
import React, {Component} from "react"
import Welcome from "./Components/Welcome"

function App() {

  fetch('http://localhost:3000/api/v1/comedians', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
      Accept: 'application/json'
    },
    body: JSON.stringify({
      user: {
        name: "sylviawoods",
        email: "whatscooking",
        password: "Sylvia Woods was an American restaurateur who founded the sould food restaurant Sylvia's in Harlem on Lenox Avenue, New York City in 1962. She published two cookbooks and was an important figure in the community.",
      }
    })
  })
    .then(r => r.json())
    .then(console.log)

  return (
      <>
        <Welcome />
      </>


  );
}

export default App;
